import React, { useState, useEffect } from 'react';
import { Header } from "./components/Header";
import { Navbar } from "./components/Navbar";
import { Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import IssueRegister from "./pages/IssueRegister";
import MyIssues from "./pages/MyIssues";
import Admin from "./pages/Admin";
import IssueDetails from "./pages/IssueDetails";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [userRole, setUserRole] = useState('');

  useEffect(() => {
    const user = JSON.parse(localStorage.getItem('user'));
    if (user && user.userId) {
      setIsLoggedIn(true);
      setUserRole(user.userRoles);
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('user');
    setIsLoggedIn(false);
    setUserRole('');
  };

  return (
    <div className="min-h-screen relative flex flex-col">
      <Routes>
        <Route path="/" element={
          <>
            <Header isLoggedIn={isLoggedIn} userRole={userRole} handleLogout={handleLogout} />
            <div className="flex flex-grow mt-16">
              <Navbar isLoggedIn={isLoggedIn} userRole={userRole} />
              <div className="flex-grow ml-60">
                <Home />
              </div>
            </div>
          </>
        } />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/issue-register" element={
          <>
            <Header isLoggedIn={isLoggedIn} userRole={userRole} handleLogout={handleLogout} />
            <div className="flex flex-grow mt-16">
              <Navbar isLoggedIn={isLoggedIn} userRole={userRole} />
              <div className="flex-grow p-4 ml-60">
                <IssueRegister />
              </div>
            </div>
          </>
        } />
        <Route path="/my-issues" element={
          <>
            <Header isLoggedIn={isLoggedIn} userRole={userRole} handleLogout={handleLogout} />
            <div className="flex flex-grow mt-16">
              <Navbar isLoggedIn={isLoggedIn} userRole={userRole} />
              <div className="flex-grow p-4 ml-60">
                <MyIssues />
              </div>
            </div>
          </>
        } />
        <Route path="/admin" element={
          <>
            <Header isLoggedIn={isLoggedIn} userRole={userRole} handleLogout={handleLogout} />
            <div className="flex flex-grow mt-16">
              <Navbar isLoggedIn={isLoggedIn} userRole={userRole} />
              <div className="flex-grow p-4 ml-60">
                <Admin />
              </div>
            </div>
          </>
        } />
        <Route path="/issue/:issueNum" element={
          <>
            <Header isLoggedIn={isLoggedIn} userRole={userRole} handleLogout={handleLogout} />
            <div className="flex flex-grow mt-16">
              <Navbar isLoggedIn={isLoggedIn} userRole={userRole} />
              <div className="flex-grow p-4 ml-60">
                <IssueDetails />
              </div>
            </div>
          </>
        } />
      </Routes>
    </div>
  );
}

export default App;
